import React from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Button } from "react-bootstrap";

function NavBar() {
  return (
    <Navbar>
      <Container className="navbarr">
        <Navbar.Brand as="nav-logo" href="/home">
			<div className="logo">HAYTHAM</div>
		</Navbar.Brand>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
			<div className="nav-items">
				<Nav.Link className="about" href="/about">About</Nav.Link>
				<Nav.Link className="projects" href="/projects">Projects</Nav.Link>
				<Nav.Link className="skills" href="/skills">Skills</Nav.Link>
				<div className="nav-btn">
					<button className="contact-btn" href="/contact">Contact</button>
				</div>
			</div>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavBar;
